import axios from "axios";
import { fetchAuthSession } from 'aws-amplify/auth';

// const apiKey = process.env.REACT_APP_APIKEY;
let accessToken; // Declare a variable to store the accessToken

const { accessToken: token, idToken } = (await fetchAuthSession()).tokens ?? {};


export const axiosClient = axios.create({
  baseURL: `https://t55gd7qb20.execute-api.us-east-1.amazonaws.com/UAT`,
  headers: {
    "Content-Type": "application/json",
    "Authorization": "Bearer" +  accessToken// Replace "authtoken" with the actual auth token
  },
  // withCredentials: false
});
